import { Component } from '@angular/core';
import { RouterOutlet } from '@angular/router';
import { Navbar } from './Navbar/navbar/navbar';
import { Hero } from './comment/hero/hero';

@Component({
  selector: 'app-root',
  imports: [RouterOutlet, Navbar, Hero, Footer],
  template: `
    <navbar/>
    <router-outlet/>
    <footer></footer>
  `,
  standalone: true
})
export class App { }
